import {setPathname} from "../Actions/setPathname";

const Pathname = (state = 0, setPathname) => {
  switch (setPathname.type) {
    case "locationPathname":
      return setPathname.payload.pathname;
    default:
      return 0;
  }
};

export default Pathname;
